export class Organization {
    constructor(id, name, slug, logoUrl, createdAt, updatedAt, publicMetadata = {}, privateMetadata = {}) {
        this.id = id;
        this.name = name;
        this.slug = slug;
        this.logoUrl = logoUrl;
        this.createdAt = createdAt;
        this.updatedAt = updatedAt;
        this.publicMetadata = publicMetadata;
        this.privateMetadata = privateMetadata;
    }
    static fromJSON(data) {
        return new Organization(data.id, data.name, data.slug, data.logo_url, data.created_at, data.updated_at, data.public_metadata, data.private_metadata);
    }
}
